spirent.methodology.CreateMethodologyCha.Series:
{SELECT CASE WHEN IsConverged THEN
ROUND(AvgThroughputFps,3) ELSE 'NA' END FROM vsw_flow_iter JOIN
vsw_flow_cfg ON FrameSize=CfgFrameSize WHERE Flows!=1 ORDER BY Flows}

spirent.methodology.CreateMethodologyCha.XAxisCategories:
{SELECT DISTINCT FrameSize || CASE WHEN FrameSize !=
'imix' THEN ' bytes' ELSE '' END AS
'name' FROM vsw_flow_iter ORDER BY FrameSize}

{SELECT FrameSize || CASE WHEN FrameSize !=
'imix' THEN ' bytes' ELSE '' END || '/'
|| Flows || ' flows' FROM vsw_flow_iter ORDER BY FrameSize, Flows}

spirent.methodology.CreateMethodologyCha.Series:
{SELECT MinLatency FROM vsw_flow_iter ORDER BY FrameSize,
Flows} {SELECT AvgLatency FROM vsw_flow_iter ORDER BY FrameSize, Flows} {SELECT
MaxLatency FROM vsw_flow_iter ORDER BY FrameSize, Flows}

spirent.methodology.CreateMethodologyCha.XAxisCategories:
{SELECT DISTINCT FrameSize || CASE WHEN FrameSize !=
'imix' THEN ' bytes' ELSE '' END AS
'name' FROM vsw_flow_iter ORDER BY FrameSize}

spirent.methodology.CreateMethodologyCha.Series:
{SELECT ROUND(AvgLatency,3) FROM vsw_flow_iter WHERE
Flows='1' ORDER BY FrameSize} {SELECT ROUND(AvgLatency,3) FROM
vsw_flow_iter WHERE Flows='1000' ORDER BY FrameSize}

spirent.methodology.CreateMethodologyCha.XAxisCategories:
{SELECT FrameSize || CASE WHEN FrameSize !=
'imix' THEN ' bytes' ELSE '' END || '/'
|| Flows || ' flows' FROM vsw_flow_iter ORDER BY FrameSize, Flows}

spirent.methodology.CreateMethodologyCha.Series:
{SELECT MinJitter FROM vsw_flow_iter ORDER BY FrameSize,
Flows} {SELECT AvgJitter FROM vsw_flow_iter ORDER BY FrameSize, Flows} {SELECT
MaxJitter FROM vsw_flow_iter ORDER BY FrameSize, Flows}

spirent.methodology.CreateMethodologyCha.XAxisCategories:
{SELECT DISTINCT FrameSize || CASE WHEN FrameSize !=
'imix' THEN ' bytes' ELSE '' END AS
'name' FROM vsw_flow_iter ORDER BY FrameSize}

spirent.methodology.CreateMethodologyCha.Series:
{SELECT ROUND(AvgJitter,3) FROM vsw_flow_iter WHERE
Flows='1' ORDER BY FrameSize} {SELECT ROUND(AvgJitter,3) FROM
vsw_flow_iter WHERE Flows='1000' ORDER BY FrameSize}
